import { VirtualDeviceService } from './../../services/virtual-device.service';
import { VirtualObjectDto } from './../../shared/models/device-dto/VirtualObjectDto.model';
import { Component, OnInit } from '@angular/core';
import { ActivatedRoute } from '@angular/router';
@Component({
  selector: 'app-edit-virtual-object',
  templateUrl: './edit-virtual-object.component.html',
  styleUrls: ['./edit-virtual-object.component.scss']
})
export class EditVirtualObjectComponent implements OnInit {



  virtualObjectDto:VirtualObjectDto;

  constructor(private route: ActivatedRoute, private virtualDeviceService: VirtualDeviceService) { }

  async ngOnInit(): Promise<void> {
    let mac = this.route.snapshot.paramMap.get('macAdr');
    let channelNumber = this.route.snapshot.paramMap.get('macAdr');
    let selectedMac = mac || "";
    let selectedChannelNumber:number = +!channelNumber;

    this.virtualObjectDto = await this.virtualDeviceService.getVirtualObjectDetails(selectedMac, selectedChannelNumber);
  }

}
<div class="my-card">
  <p-table  [value]="virtualObjectList" [rowHover]="true">
    <ng-template pTemplate="header">
        <tr class="ListHeaders">
          <th class="header-field" pSortableColumn="mac">Mac adress<p-sortIcon field="mac"></p-sortIcon></th>
          <th class="header-field" pSortableColumn="channelNumber">Channel number<p-sortIcon field="channelNumber"></p-sortIcon></th>
          <th class="header-field" pSortableColumn="localizationDto.longitude">Longitude<p-sortIcon field="localizationDto.longitude"></p-sortIcon></th>
          <th class="header-field" pSortableColumn="localizationDto.latitude">Latitude<p-sortIcon field="localizationDto.latitude"></p-sortIcon></th>
          <th class="header-field" pSortableColumn="description">Description<p-sortIcon field="description"></p-sortIcon></th>
          <th class="header-field" pSortableColumn="desiredType">Desired type<p-sortIcon field="desiredType"></p-sortIcon></th>
          <th style="text-align: center;">
            <button routerLink="/virtualDevices/add" pButton type="button" class="p-button-secondary" icon="fas fa-plus">
            </button>
          </th>
        </tr>
    </ng-template>
    <ng-template pTemplate="body" let-vo>
        <tr class="p-selectable-row content-row">
          <td>
            {{vo.mac}}
        </td>
        <td>
          {{vo.channelNumber}}
      </td>
      <td>
        {{vo.localizationDto.latitude}}
      </td>
      <td>
        {{vo.localizationDto.longitude}}
      </td>
      <td>
       {{vo.description}}
      </td>
      <td>
        {{vo.desiredType}}
      </td>
      <td style="text-align: center">
        <button [routerLink]="['/virtualDevices/', vo.mac, vo.channelNumber ]" pButton type="button" class="p-button-secondary" icon="pi pi-cog"></button>
    </td>
        </tr>
    </ng-template>
  </p-table>
  </div>
